  fullName: "com.google.cloud.memcache.v1beta2.CloudMemcacheSettings"
  type: "Class"
  package: "com.google.cloud.memcache.v1beta2"
  summary: "Settings class to configure an instance of <xref uid=\"com.google.cloud.memcache.v1beta2.CloudMemcacheClient\" data-throw-if-not-resolved=\"false\">CloudMemcacheClient</xref>.\n\nThe default instance has everything set to sensible defaults:\n\n *  The default service address (memcache.googleapis.com) and default port (443) are used.\n *  Credentials are acquired automatically through Application Default Credentials.\n *  Retries are configured for idempotent methods but not for non-idempotent methods.\n\nThe builder of this class is recursive, so contained classes are themselves builders. When build() is called, the tree of builders is called to create the complete settings object.\n\nFor example, to set the total timeout of getInstance to 30 seconds:\n\n```java\nCloudMemcacheSettings.Builder cloudMemcacheSettingsBuilder = CloudMemcacheSettings.newBuilder();\n cloudMemcacheSettingsBuilder\n     .getInstanceSettings()\n     .setRetrySettings(\n         cloudMemcacheSettingsBuilder\n             .getInstanceSettings()\n             .getRetrySettings()\n             .toBuilder()\n             .setTotalTimeout(Duration.ofSeconds(30))\n             .build());\n CloudMemcacheSettings cloudMemcacheSettings = cloudMemcacheSettingsBuilder.build();\n```"
  syntax:
    content: "public class CloudMemcacheSettings extends ClientSettings<CloudMemcacheSettings>"
